import React, {useEffect} from 'react';
import alanBtn from '@alan-ai/alan-sdk-web'

const alanKey ='146b4c9d814c35f32685d3b0ec4e00842e956eca572e1d8b807a3e2338fdd0dc/stage';
const App = () =>{
    useEffect(()=>{
        alanBtn({
            key: alanKey,
            onCommand: ({command, articles}) => {
                if(command === 'newHeadlines'){
                    console.log(articles);
                    

                }
            }
        })

    },[])
    return(
        <div>
            <h1>Ai enabled News Application</h1>
        </div>
    );

}


export default App;
